import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import { Link } from "react-router-dom";
import "./Footer.scss";

const Footer = () => {
  return (
    <section className="custom-footer-parent">
      <Container fluid>
        <Row>
          <Col lg={12}>

          </Col>
        </Row>
      </Container>
    </section>
  );
};

export default Footer;
